import React from 'react';
import Navbar from 'react-bootstrap/Nav';
import { FaHome, FaThList, FaUsers, FaComments, FaUser } from "react-icons/fa";

export default () => {

    return (
    <Navbar justify defaultActiveKey="/home" sticky="bottom" fixed="bottom">
        <Navbar.Item>
            <Navbar.Link href="/home"><FaHome /> <br /> Feed </Navbar.Link>
        </Navbar.Item>
        <Navbar.Item>
            <Navbar.Link eventKey="link-1"><FaThList /> <br /> Categories</Navbar.Link>
        </Navbar.Item>
        <Navbar.Item>
            <Navbar.Link eventKey="link-2"><FaUsers /> <br /> Community</Navbar.Link>
        </Navbar.Item>
        <Navbar.Item>
            <Navbar.Link eventKey="link-2"><FaComments /> <br /> Chat</Navbar.Link>
        </Navbar.Item>
        <Navbar.Item>
            <Navbar.Link eventKey="link-2"><FaUser /> <br /> Profile</Navbar.Link>
        </Navbar.Item>
    </Navbar>
)}
